import PropTypes from "prop-types";

function Card({title, imgURL}) {

  return (
    <div class="card">
      <div class="recipe_img">
        <img src={"./images/recipe/steak.jpg"} alt="img" />
      </div>
      <p>Steak&French fries</p>
      <button type="submit">Check Out</button>
    </div>
  );
}

export default Card;
